package basicPrograms;

public class oddNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i=1;
		
		while (i<=100) {
			
			if(i%2 != 0) {
				System.out.println("odd number: " + i);
			}
			i++;
		   System.out.println("Fixing on main branch");
		}

	}

}
